import React from "react";
import AlternateEmailIcon from "@mui/icons-material/AlternateEmail";
import { Box } from "@mui/material";

const AppBar = ({ channel }) => {
  return (
    <Box>
         {channel.name}
      <Box sx={{flexGrow : 1}}/>
      {channel.name}
    </Box>
  );
};

export default AppBar;
